import React from "react";

const TodoList = ({ todos }) => {
  return (
    <div>
      <ul className="list-group">
        {todos.map((todo) => (
          <li className="list-group-item">An item</li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
